using Microsoft.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore.ChangeTracking;
using Microsoft.EntityFrameworkCore.Storage.ValueConversion;
using Newtonsoft.Json;
using SGED.Objects.Models.Entities;

namespace SGED.Context.Builders
{
    public class ImovelBuilder
    {
        public static void Build(ModelBuilder modelBuilder)
        {
            // Builder
            modelBuilder.Entity<ImovelModel>().Property(i => i.Id);
            modelBuilder.Entity<ImovelModel>().Property(i => i.InscricaoCadastral).IsRequired();
            modelBuilder.Entity<ImovelModel>().Property(i => i.NumeroImovel).HasMaxLength(6).IsRequired();
            modelBuilder.Entity<ImovelModel>().Property(i => i.AreaTerreno).IsRequired();
            modelBuilder.Entity<ImovelModel>().Property(i => i.AreaConstruida).IsRequired();
            modelBuilder.Entity<ImovelModel>().Property(i => i.CondicoesSolo).IsRequired();
            modelBuilder.Entity<ImovelModel>().Property(i => i.ValorVenal).IsRequired();
            modelBuilder.Entity<ImovelModel>().Property(i => i.ValorMercado).IsRequired();
            modelBuilder.Entity<ImovelModel>().Property(i => i.IdLogradouro).IsRequired();
            modelBuilder.Entity<ImovelModel>().Property(i => i.IdProprietario).IsRequired();
            modelBuilder.Entity<ImovelModel>().Property(i => i.IdContribuinte).IsRequired();
            modelBuilder.Entity<ImovelModel>().Property(i => i.IdTopografia).IsRequired();
            modelBuilder.Entity<ImovelModel>().Property(i => i.IdUso).IsRequired();
            modelBuilder.Entity<ImovelModel>().Property(i => i.IdOcupacaoAtual).IsRequired();

            // Declaração: Defini o ID como Chave Primária
            modelBuilder.Entity<ImovelModel>().HasKey(i => i.Id);

            // Configuração do conversor para LocalizacaoGeografica (array de long)
            var arrayLongConverter = new ValueConverter<long[], string>(
                v => JsonConvert.SerializeObject(v),
                v => JsonConvert.DeserializeObject<long[]>(v) ?? new long[2]);

            var arrayLongComparer = new ValueComparer<long[]>(
                (c1, c2) => c1.SequenceEqual(c2),
                c => c.Aggregate(0, (a, v) => HashCode.Combine(a, v.GetHashCode())),
                c => c.ToArray());

            modelBuilder.Entity<ImovelModel>().Property(i => i.LocalizacaoGeografica).HasConversion(arrayLongConverter).Metadata.SetValueComparer(arrayLongComparer);

            // Configuração do conversor para ImagemImovel (lista de string)
            var listStringConverter = new ValueConverter<List<string>, string>(
                v => JsonConvert.SerializeObject(v),
                v => JsonConvert.DeserializeObject<List<string>>(v) ?? new List<string>());

            var listStringComparer = new ValueComparer<List<string>>(
                (c1, c2) => c1.SequenceEqual(c2),
                c => c.Aggregate(0, (a, v) => HashCode.Combine(a, v.GetHashCode())),
                c => c.ToList());

            modelBuilder.Entity<ImovelModel>().Property(i => i.ImagemImovel).HasConversion(listStringConverter).Metadata.SetValueComparer(listStringComparer);

            // Relacionamento: Logradouro -> Imovel
            modelBuilder.Entity<ImovelModel>()
                .HasOne(i => i.Logradouro)
                .WithMany(l => l.Imoveis)
                .HasForeignKey(i => i.IdLogradouro)
                .OnDelete(DeleteBehavior.Cascade);

            // Relacionamento: Municipe(proprietario) -> Imovel
            modelBuilder.Entity<ImovelModel>()
                .HasOne(i => i.Proprietario)
                .WithMany(m => m.ImoveisProprietario)
                .HasForeignKey(i => i.IdProprietario)
                .OnDelete(DeleteBehavior.Restrict);

            // Relacionamento: Municipe(contribuinte) -> Imovel
            modelBuilder.Entity<ImovelModel>()
                .HasOne(i => i.Contribuinte)
                .WithMany(m => m.ImoveisContribuinte)
                .HasForeignKey(i => i.IdContribuinte)
                .OnDelete(DeleteBehavior.Restrict);

            // Relacionamento: Topografia -> Imovel
            modelBuilder.Entity<ImovelModel>()
                .HasOne(i => i.Topografia)
                .WithMany(t => t.Imoveis)
                .HasForeignKey(i => i.IdTopografia)
                .OnDelete(DeleteBehavior.Cascade);

            // Relacionamento: TipoUso -> Imovel
            modelBuilder.Entity<ImovelModel>()
                .HasOne(i => i.Uso)
                .WithMany(tu => tu.Imoveis)
                .HasForeignKey(i => i.IdUso)
                .OnDelete(DeleteBehavior.Cascade);

            // Relacionamento: OcupacaoAtual -> Imovel
            modelBuilder.Entity<ImovelModel>()
                .HasOne(i => i.OcupacaoAtual)
                .WithMany(oa => oa.Imoveis)
                .HasForeignKey(i => i.IdOcupacaoAtual)
                .OnDelete(DeleteBehavior.Cascade);


            // Inserções
            modelBuilder.Entity<ImovelModel>().HasData(
                new ImovelModel
                {
                    Id = 1,
                    InscricaoCadastral = "000123456",
                    NumeroImovel = "1304",
                    AreaTerreno = "5000 m²",
                    AreaConstruida = "2500 m²",
                    CondicoesSolo = "Estável",
                    ValorVenal = "R$ 10.000.000,00",
                    ValorMercado = "R$ 13.500.000,00",
                    IdLogradouro = 16,
                    IdProprietario = 5,
                    IdContribuinte = 6,
                    IdTopografia = 1,
                    IdUso = 1,
                    IdOcupacaoAtual = 5,
                    LocalizacaoGeografica = new long[] { -0, -0 },
                    ImagemImovel = new List<string> {
                        "data:image/jpeg;base64,",
                        "data:image/jpeg;base64,",
                        "data:image/jpeg;base64,"
                    }
                },
                new ImovelModel
                {
                    Id = 2,
                    InscricaoCadastral = "000654321",
                    NumeroImovel = "4565",
                    AreaTerreno = "10000 m²",
                    AreaConstruida = "8000 m²",
                    CondicoesSolo = "Estável",
                    ValorVenal = "R$ 5.000.000,00",
                    ValorMercado = "R$ 7.000.000,00",
                    IdLogradouro = 17,
                    IdProprietario = 11,
                    IdContribuinte = 3,
                    IdTopografia = 1,
                    IdUso = 2,
                    IdOcupacaoAtual = 5,
                    LocalizacaoGeografica = new long[] { -0, -0 },
                    ImagemImovel = new List<string> {
                        "data:image/jpeg;base64,",
                        "data:image/jpeg;base64,"
                    }
                }
            );
        }
    }

}
